func (cls *CardLogSelect) sqlScan(ctx context.Context, v interface{}) error {
	rows := &sql.Rows{}
	query, args := cls.sqlQuery().Query()
	if err := cls.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

func (cls *CardLogSelect) sqlQuery() sql.Querier {
	selector := cls.sql
	selector.Select(selector.Columns(cls.fields...)...)
	return selector
}
